INSERT INTO `contests` (`shortname`, `title`, `description`, `index_text`, `rules`, `date`, `past`, `schedule`, `results`, `show_schedule`) VALUES
('school-2013', 'Ural SchoolCTF', 'Первые на Урале соревнования по правилам QCTF для школьников старших классов.', '<p>Прежде всего хотелось бы рассказать о том, что такое CTF, и с чем это едят.</p><p>CTF (Capture The Flag) — это командные соревнования, целью которых является оценка умения участников атаковать и защищать компьютерные системы. Появились они в США уже давно (более 20 лет назад), а в России впервые были проведены на Урале в 2006 году. </p><p>Вкратце описание процесса игры следующее. Командам даётся набор заданий (тасков) из разных категорий и областей знаний. Команда пытается выполнить их любым доступным образом, применяя накопленные ими знания. Результатом решения является некий ключ, который и необходимо отправить на проверку.</p><p>Более подробную информацию о предстоящих соревнованиях вы можете найти на <a href=\"rules.php\">странице правил</a>.</p><p>Чтобы лучше понять, что такое CTF, предлагаем ознакомиться вам с решениями двух интересных задачек из категорий <a href=\"reverse.php\">Reverse engineering</a> и <a href=\"network.php\">Network (сети)</a>. Не расстраивайтесь, если вам будет понятно не всё &mdash; эти задания достаточно трудны. В случае возникновения вопросов обязательно пишите на <a href=\"mailto:UralSchoolCTF@HackerDom.ru\">UralSchoolCTF@HackerDom.ru</a>.</p><p>Репозиторий соревнования доступен на <a href=\"https://github.com/HackerDom/school.uralctf.ru-2013\">GitHub</a>', '<p>Данные правила могут измениться в любой момент до начала отборочного этапа. Не забудьте прочитать их еще раз непосредственно перед началом игры.</p>\r\n<ul>\r\n<li>Соревнования по защите информации Ural SchoolCTF проходят очно в здании <a href=\"http://imkn.urfu.ru\">ИМКН УрФУ</a>.</li>\r\n<li>Соревнования командные. К участию допускаются команды, состоящие не более чем из 4 человек,&nbsp;среди которых обязательно присутствует капитан. Состав команды нельзя менять после начала игры.</li>\r\n<li>Командам будет предложено решить задания (таски).&nbsp;За успешное решение задания команда получает баллы, количество которых зависит от сложности задания. Целью команд является максимизация своих баллов.</li>\r\n<li>Таски размещаются на специальном сервере заданий. Командам перед началом игры будут выданы данные для доступа к этому серверу.&nbsp;</li>\r\n<li>Для сторонних наблюдателей доступен публичный монитор, на котором они смогут следить за прогрессом команд. Ссылка на монитор будет опубликована на данном сайте после начала игры.</li>\r\n<li>Во время соревнований командам запрещается генерировать неоправданно большой объем трафика и проводить DoS-атаки на жюри или других участников, не связанные с решением тасков. Также командам запрещается использовать уязвимости сервера заданий с целью получения незаслуженных баллов. Команды-нарушители должны быть готовы к штрафу или дисквалификации.</li>\r\n<li>Организаторы соревнований прикладывают все усилия для того, чтобы игра была качественной и интересной. Тем не менее, во время игры могут возникнуть исключительные ситуации. Команды должны с пониманием относиться к такой возможности и к решениям, которые будут приняты организаторами в этих ситуациях.</li>\r\n</ul>\r\n<div>&nbsp;</div>\r\n<ul>\r\n<li>Для участия в соревновании команде необходимо подать заявку на сайте, а также прийти на очную регистрацию для получения данных для авторизации.</li>\r\n<li>В день соревнования, каждой команде будет предоставлено рабочее место, оборудованное:\r\n<ul>\r\n<li>Двумя компьютерами под управлением ОС Windows, с выходом в интернет.</li>\r\n<li>Сетевым фильтром для подключения ноутбуков</li>\r\n<li>Достаточным WiFI сигналом для подключения ваших ноутбуков к сети интернет.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>Вопросы и замечания присылайте на почту:&nbsp;<a href=\"mailto:uralschoolctf@hackerdom.ru\">UralSchoolCTF@HackerDom.ru</a></p>', '6&nbsp;апреля&nbsp;2013&nbsp;', 1, '<h3>Екатеринбург</h3>\r\n\r\n<p>Обратите внимание, что заходить в университет нужно через главный вход (Ленина, 51)\r\n</p>\r\n\r\n<li>9:30 - Регистрация</li>\r\n<li>10:00 - Открытие</li>\r\n<li>10:40 - Начало соревнований</li>\r\n<li>14:00 - Обед</li>\r\n<li>15:00 - Продолжение соревнований</li>\r\n<li>19:00 - Окончание соревнований</li>\r\n<li>19:30 - Награждение</li>\r\n</ul>\r\n', '<style>\r\n  .team-members {\r\n    font-size: 70%;\r\n  }\r\n\r\n  .team-name {\r\n    color: rgb(90, 90, 255);\r\n  }\r\n\r\n  .team-name div {\r\n    color: white;\r\n  }\r\n</style>\r\n<table class=\"table table-striped table-hover table-responsive\">\r\n  <thead>\r\n    <tr>\r\n      <th>Место</th><th>Площадка</th><th>Название и состав команды</th><th>Очки</th>\r\n    </tr>\r\n  </thead>    \r\n  <tbody>\r\n    <tr>\r\n      <td width=\"50\">1</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Good_Guys_Green<div class=\"team-members\">Базун Филипп, Дубровин Алексей, Першаков Максим, Котвицкий Викентий</div><div class=\"team-members\">Гимназия №35, Гимназия №9, СУНЦ УрФУ, Гимназия №41 г. Новоуральск</div></td><td>700</td>\r\n    </tr>\r\n    <tr>\r\n      <td width=\"50\">1</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Nelson<div class=\"team-members\">Шкляев Вячеслав, Борзунов Александр, Кругликов Николай, Лисс Артур</div><div class=\"team-members\">СУНЦ УрФУ, Гимназия №9</div></td><td>700</td>\r\n    </tr>    \r\n    <tr>\r\n      <td width=\"50\">3</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Октоторп<div class=\"team-members\">Старцев Леонид, Семериков Глеб, Маевский Валерий</div><div class=\"team-members\"Лицей №110</div></td><td>600</td>\r\n    </tr>    \r\n    <tr>\r\n      <td width=\"50\">4</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">while(true)<div class=\"team-members\">Мазеин Константин, Леменков Даниил, Старцев Матвей, Цыпушкин Арсений</div><div class=\"team-members\">СУНЦ УрФУ</div></td><td>500</td>\r\n    </tr>    \r\n    <tr>\r\n      <td width=\"50\">5</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Kopeicev<div class=\"team-members\">Копейцев Вячеслав</div><div class=\"team-members\">Лицей №135</div></td><td>400</td>\r\n    </tr>    \r\n    <tr>\r\n      <td width=\"50\">5</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Клац<div class=\"team-members\">Бороздин Кирилл, Кучумов Илья, Сивухин Никита, Пивко Максим</div><div class=\"team-members\">СУНЦ УрФУ, Гимназия №9</div></td><td>400</td>\r\n    </tr>    \r\n    <tr>\r\n      <td width=\"50\">5</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">[*]w00t<div class=\"team-members\"></div><div class=\"team-members\"></div></td><td>400</td>\r\n    </tr>    \r\n    <tr>\r\n      <td width=\"50\">8</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">O(n^n)<div class=\"team-members\">Миронов Данил, Япаров Богдан, Бородин Николай, Жданов Илья</div><div class=\"team-members\">СУНЦ УрФУ</div></td><td>300</td>\r\n    </tr>            \r\n    <tr>\r\n      <td width=\"50\">9</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">КиберБарбариска<div class=\"team-members\">Дьяков Роман, Шнейдер Ярослав, Курлович Александра, Белова Мария</div><div class=\"team-members\">Гимназия №9</div></td><td>200</td>\r\n    </tr>    \r\n    <tr>\r\n      <td width=\"50\">9</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Delphi<div class=\"team-members\"></div><div class=\"team-members\"></div></td><td>200</td>\r\n    </tr>\r\n    <tr>\r\n      <td width=\"50\">9</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">rooster.exe<div class=\"team-members\">Люкин Сергей, Никифоров Александр</div><div class=\"team-members\">СУНЦ УрФУ</div></td><td>200</td>\r\n    </tr>    \r\n    <tr>\r\n      <td width=\"50\">12</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Qwerty777<div class=\"team-members\">Самков Алексей, Акулич Сергей</div><div class=\"team-members\">Гимназия №35, МАОУ-СОШ № 148</div></td><td>100</td>\r\n    </tr>    \r\n    <tr>\r\n      <td width=\"50\">12</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Harlem_team<div class=\"team-members\">Алексеев Александр, Вольский Евгений, Банных Севастьян </div><div class=\"team-members\">СУНЦ УрФУ</div></td><td>100</td>\r\n    </tr>    \r\n    <tr>\r\n      <td width=\"50\">12</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Альфа-Канал<div class=\"team-members\">Банников Илья, Пепелев Алексей, Конев Антон</div><div class=\"team-members\">МБОУ Гимназия №120, МАОУ СОШ №2, Богданович, МКОУ СОШ №1, Богданович</div></td><td>100</td>\r\n    </tr>\r\n    <tr>\r\n      <td width=\"50\">12</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Сладкий Хлебушек<div class=\"team-members\">Девятов Александр, Коврижных Мария, Санников Николай, Успенская Наталья</div><div class=\"team-members\">Гимназия №9</div></td><td>100</td>\r\n    </tr>            \r\n    <tr>\r\n      <td width=\"50\">12</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">noob_style<div class=\"team-members\">Ширинкин Владислав, Лужбин Даниил</div><div class=\"team-members\">Школа №76</div></td><td>100</td>\r\n    </tr>    \r\n    <tr>\r\n      <td width=\"50\">12</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Bash.org/i/ya<div class=\"team-members\">Галеев Александр, Мельников Евгений, Прошин Станислав, Карькин Александр</div><div class=\"team-members\">СУНЦ УрФУ</div></td><td>100</td>\r\n    </tr>\r\n  </tbody>\r\n</table>', 0),
('school-2014', 'QCTF School 2014', 'Соревнования по правилам QCTF для школьников старших классов. Проводится с 2013 года (<a href=\"/school-2013/\">Ural SchoolCTF</a>). С 2014 года проводится в разных городах России.', '<p>\nПрежде всего хотелось бы рассказать о том, что такое CTF, и с чем это едят.\n</p>\n<p>\nCTF (Capture The Flag) — это командные соревнования, целью которых является оценка умения участников атаковать и защищать компьютерные системы. Появились они в США уже давно (более 20 лет назад), а в России впервые были проведены на Урале в 2006 году. \n</p>\n<p>\nВкратце описание процесса игры следующее. Командам даётся набор заданий (тасков) из разных категорий и областей знаний. Команда пытается выполнить их любым доступным образом, применяя накопленные ими знания. Результатом решения является некий ключ, который и необходимо отправить на проверку.\n</p>\n<p>\nБолее подробную информацию о предстоящих соревнованиях вы можете найти на <a href=\"rules.php\">странице правил</a>.\n</p>\n<p>\nЧтобы лучше понять, что такое CTF, предлагаем ознакомиться вам с решениями двух интересных задачек из категорий <a href=\"reverse.php\">Reverse engineering</a> и <a href=\"network.php\">Network (сети)</a>. Не расстраивайтесь, если вам будет понятно не всё &mdash; эти задания достаточно трудны. В случае возникновения вопросов обязательно пишите на <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a>.\n</p>\n<p>Репозиторий соревнования доступен на <a href=\"https://github.com/HackerDom/qctf-school-2014\">GitHub</a>', '<p>\nДанные правила могут измениться в любой момент до начала отборочного этапа. Не забудьте прочитать их еще раз непосредственно перед началом игры.\n</p>\n<ul>\n<li>\nСоревнования по защите информации QCTF School проводятся очно в специально организованных точках проведения.\n<li>К участию в соревновании допускают только школьники, являющиеся учащимися средних учебных заведений в 2013-2014 учебном году и на момент проведения соревнования.\n<li>\nСоревнования командные. К участию допускаются команды, состоящие не более чем из 4 человек, среди которых обязательно присутствует капитан. Состав команды нельзя менять после начала игры.\n<li>\nКомандам будет предложено решить задания. За успешное решение задания команда получает баллы, количество которых зависит от сложности задания. Цель команды &mdash; набрать как можно больше баллов.\n<li>\nЗадания  размещаются на специальном сервере заданий. Командам перед началом игры будут выданы данные для доступа к нему.\n<li> \nДля сторонних наблюдателей доступен публичный монитор, на котором они смогут следить за прогрессом команд. Ссылка на монитор будет опубликована на данном сайте после начала игры.\n<li>\nВо время соревнований командам запрещается генерировать неоправданно большой объем трафика и проводить DoS-атаки на жюри или других участников, не связанные с решением заданий. Командам также запрещается использовать уязвимости сервера заданий с целью получения незаслуженных баллов. Команды-нарушители могут быть оштрафованы или дисквалифицированы по решению Жюри.\n<li>\nОрганизаторы соревнований прикладывают все усилия для того, чтобы игра была качественной и интересной. Тем не менее, во время игры могут возникнуть исключительные ситуации. Мы просим команды с пониманием относиться к такой возможности и к решениям, которые будут приняты организаторами в этих ситуациях.\nОфициальными источниками информации по соревнованию являются: этот сайт, группа ВКонтакте <a href=\"http://vk.com/qctfcontest\">http://vk.com/qctfcontest</a>, письма организаторов, отправленные с адреса qctf@hackerdom.ru.\n<li> \nДля участия в соревновании команде необходимо подать заявку на сайте, а также прийти на очную регистрацию для получения авторизационных данных.\nВ день соревнования каждой команде будет предоставлено рабочее место, оборудованное:\n<ul>\n<li>\nДвумя компьютерами под управлением ОС Windows, с выходом в интернет;\n<li>\nСетевым фильтром для подключения ноутбуков;\n<li>\nДостаточным Wi-Fi сигналом для подключения ваших ноутбуков к сети интернет.\n</ul>\n</ul>\n</p>\n\n<p>\nВопросы и замечания присылайте на почту: <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a>.\n</p>', '27&nbsp;апреля&nbsp;2014&nbsp;', 1, '<h3>Екатеринбург</h3><p>Обратите внимание, что заходить в университет нужно через главный вход (Ленина, 51)</p><ul><li>9:30 &mdash; Регистрация (холл)<li>10:00 &mdash; Открытие (Демидовский зал)<li>10:30 &mdash; Начало соревнования (компьютерные классы ИМКН)<li>14:30&ndash;15:30 &mdash; Обеденный перерыв (ауд. 532)<li>15:30 &mdash; Соревнование продолжается (компьютерные классы ИМКН)<li>19:30 &mdash; Окончание соревнования<li>19:45 &mdash; Разбор задач и награждение победителей (Демидовский зал)</ul><h3>Москва</h3><i>Время московское, актуальное расписание нужно проверять <a href=\"http://5kr.mosuzedu.ru/CTFtasks/point.php\">на сайте точки проведения в Москве</a>.</i><ul><li>9:00 — Регистрация (холл первого этажа)<li>9:30 — Открытие<li>10:00 — Начало соревнования (второй этаж)<li>14:00–15:00 — Обеденный перерыв (столовая универмага \"Москва\", платно)<li>15:00 — Соревнование продолжается (второй этаж)<li>19:00 — Окончание соревнования<li>19:15 — Разбор задач и награждение победителей</ul>', '<style>  .team-members {    font-size: 70%;  }  .team-name {    color: rgb(90, 90, 255);  }  .team-name div {    color: white;  }</style><table class=\"table table-striped table-hover table-responsive\">  <thead>    <tr>      <th>Место</th><th>Площадка</th><th>Название и состав команды</th><th>Очки</th>    </tr>  </thead>      <tbody>    <tr>      <td width=\"50\">1</td><td>Москва, &laquo;Вторая школа&raquo;</td><td class=\"team-name\">179#1<div class=\"team-members\">Галов Дмитрий, Хачатрян Артём, Лозко Роман, Тимощенко Георгий</div><div class=\"team-members\">Школа №179</div></td><td>900</td>    </tr>    <tr>      <td width=\"50\">2</td><td>Екатеринбург, УрФУ</td><td class=\"team-name\">Yet Another Team<div class=\"team-members\">Котвицкий Викен