('school-2015', 'QCTF School 2015', 'Соревнования по правилам QCTF для школьников старших классов. Проводится с 2013 года (<a href=\"/school-2013/\">Ural SchoolCTF</a>). С&nbsp;<a href=\"/school-2014/\">2014 года</a> проводится в разных городах России. <!-- <span style=\"color: white\">Текущие результаты доступны на <a href=\"http://game.qctf.ru\">game.qctf.ru</a> и <a href=\"http://tomsk.qctf.ru\">tomsk.qctf.ru</a> (площадка в Томске).</span> -->', '<p>\r\nПрежде всего хотелось бы рассказать о том, что такое CTF, и с чем это едят.\r\n</p>\r\n<p>\r\nCTF (Capture The Flag) — это командные соревнования, целью которых является оценка умения участников атаковать и защищать компьютерные системы. Появились они в США уже давно (более 20 лет назад), а в России впервые были проведены на Урале в 2006 году. \r\n</p>\r\n<p>\r\nВкратце описание процесса игры следующее. Командам даётся набор заданий (тасков) из разных категорий и областей знаний. Команда пытается выполнить их любым доступным образом, применяя накопленные ими знания. Результатом решения является некий ключ, который и необходимо отправить на проверку.\r\n</p>\r\n<p>\r\nБолее подробную информацию о предстоящих соревнованиях вы можете найти на <a href=\"rules.php\">странице правил</a>.\r\n</p>\r\n<p>\r\nЧтобы лучше понять, что такое CTF, предлагаем ознакомиться вам с решениями двух интересных задачек из категорий <a href=\"reverse.php\">Reverse engineering</a> и <a href=\"network.php\">Network (сети)</a>. Не расстраивайтесь, если вам будет понятно не всё &mdash; эти задания достаточно трудны. В случае возникновения вопросов обязательно пишите на <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a>.\r\n</p>\r\n<p>Задания соревнований прошлого года доступны на <a href=\"https://github.com/HackerDom/qctf-school-2014\">гитхабе</a>', '<p>Данные правила могут измениться в любой момент до начала соревнования. Не забудьте прочитать их еще раз непосредственно перед началом игры.</p><ul><li>Соревнования по защите информации QCTF School проводятся очно в специально организованных точках проведения.<li>К участию в соревновании допускаются только школьники, являющиеся учащимися средних учебных заведений в 2014-2015 учебном году и на момент проведения соревнования.<li>Соревнования командные. К участию допускаются команды, состоящие не более чем из 4 человек, среди которых обязательно присутствует капитан. Состав команды нельзя менять после начала игры.<li>Командам будет предложено решить задания. За успешное решение задания команда получает баллы, количество которых зависит от сложности задания. Цель команды &mdash; набрать как можно больше баллов.<li>Задания  размещаются на специальном сервере заданий. Командам перед началом игры будут выданы данные для доступа к нему.<li> Для сторонних наблюдателей доступен публичный монитор, на котором они смогут следить за прогрессом команд. Ссылка на монитор будет опубликована на данном сайте после начала игры.<li>Во время соревнований командам запрещается генерировать неоправданно большой объем трафика и проводить DoS-атаки на жюри или других участников, не связанные с решением заданий. Командам также запрещается использовать уязвимости сервера заданий с целью получения незаслуженных баллов. Команды-нарушители могут быть оштрафованы или дисквалифицированы по решению Жюри.<li>Организаторы соревнований прикладывают все усилия для того, чтобы игра была качественной и интересной. Тем не менее, во время игры могут возникнуть исключительные ситуации. Мы просим команды с пониманием относиться к такой возможности и к решениям, которые будут приняты организаторами в этих ситуациях.Официальными источниками информации по соревнованию являются: этот сайт, группа ВКонтакте <a href=\"http://vk.com/qctfcontest\">http://vk.com/qctfcontest</a>, письма организаторов, отправленные с адреса qctf@hackerdom.ru.<li> Для участия в соревновании команде необходимо подать заявку на сайте, а также прийти на очную регистрацию для получения авторизационных данных.В день соревнования каждой команде будет предоставлено рабочее место, оборудованное:<ul><li>Двумя компьютерами под управлением ОС Windows, с выходом в интернет;<li>Сетевым фильтром для подключения ноутбуков;<li>Достаточным Wi-Fi сигналом для подключения ваших ноутбуков к сети интернет.</ul></ul></p><p>Вопросы и замечания присылайте на почту: <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a>.</p>', '10&nbsp;мая&nbsp;2015&nbsp;г.', 1, '<i>Время на этой странице &mdash; местное</i>\r\n<h3>Екатеринбург</h3>\r\n<p>Участники из Екатеринбурга &mdash; обратите внимание, что входить в УрФУ нужно через главный вход (пр. Ленина, 51)</p>\r\n<ul>\r\n    <li>11:00 &mdash; Регистрация (холл на Ленина, 51)\r\n    <li>11:30 &mdash; Открытие\r\n    <li>12:00 &mdash; Начало соревнования\r\n    <li>20:00 &mdash; Окончание соревнования\r\n    <li>20:30 &mdash; Награждение победителей\r\n</ul>\r\n<h3>Томск</h3>\r\n<ul>\r\n    <li>10:30 &mdash; Регистрация и открытие (ауд. 204 второго корпуса ТГУ, пр. Ленина, 36)\r\n    <li>11:00 &mdash; Начало соревнования\r\n    <li>19:00 &mdash; Окончание соревнования\r\n    <li>19:30 &mdash; Награждение победителей\r\n</ul>\r\n<h3>Петрозаводск</h3>\r\n<ul>\r\n    <li>9:15 &mdash; Регистрация\r\n    <li>10:00 &mdash; Начало соревнования\r\n    <li>18:00 &mdash; Окончание соревнования\r\n    <li>18:30 &mdash; Награждение победителей\r\n</ul>\r\n', '<style>  .team-members {    font-size: 70%;  }  .team-name {    color: rgb(90, 90, 255);  }  .team-name div {    color: white;  }</style>\r\n<table class=\"table table-striped table-hover table-responsive\">\r\n    <thead>\r\n        <tr>\r\n            <th>Место</th>\r\n            <th>Площадка</th>\r\n            <th>Название и состав команды</th>\r\n            <th>Очки</th>\r\n        </tr>\r\n    </thead>\r\n    <tbody>\r\n        <tr>\r\n            <td width=\"50\">1</td>\r\n            <td>Екатеринбург, УрФУ</td>\r\n            <td class=\"team-name\">DVCuriosity\r\n                <div class=\"team-memb