('school-2016', 'QCTF School 2016', 'Соревнования по правилам QCTF для школьников старших классов. Проводится с 2013 года (<a href=\"/school-2013/\">Ural SchoolCTF</a>). С&nbsp;<a href=\"/school-2014/\">2014 года</a> проводится в разных городах России.', '<p>\r\nCTF (Capture The Flag) — это командные соревнования, цель которых — оценка умения участников разбираться в компьютерах. \r\n</p>\r\n<p>\r\nКомандам даётся набор заданий из разных областей знаний. Команда выполняет их любым доступным образом. Результатом решения является некоторая строка, которую и необходимо отправить на проверку.\r\n</p>\r\n<p>\r\nБолее подробную информацию о предстоящих соревнованиях вы можете найти на <a href=\"rules.php\">странице правил</a>.\r\n</p>\r\n<p>\r\nПишите нам на <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a>.\r\n</p>\r\n<p>Задания прошлых лет доступны вместе с разборами на гитхабе: <a href=\"https://github.com/HackerDom/qctf-school-2015\">2015</a>, <a href=\"https://github.com/HackerDom/qctf-school-2014\">2014</a>', '<p>Данные правила могут измениться в любой момент до начала соревнования. Не забудьте прочитать их еще раз непосредственно перед началом игры.</p><ul><li>Соревнования QCTF School проводятся очно в специально организованных точках проведения.<li>К участию в соревновании допускаются только школьники, являющиеся учащимися средних учебных заведений в 2015-2016 учебном году и на момент проведения соревнования.<li>Соревнования командные. К участию допускаются команды, состоящие не более чем из 4 человек, среди которых обязательно присутствует капитан. Состав команды нельзя менять после начала игры.<li>Командам будет предложено решить задания. За успешное решение задания команда получает баллы, количество которых зависит от сложности задания. Цель команды &mdash; набрать как можно больше баллов.<li>Задания  размещаются на специальном сервере заданий. Командам перед началом игры будут выданы данные для доступа к нему.<li> Для сторонних наблюдателей доступен публичный монитор, на котором они смогут следить за прогрессом команд. Ссылка на монитор будет опубликована на данном сайте после начала игры.<li>Во время соревнований командам запрещается генерировать неоправданно большой объем трафика и проводить DoS-атаки на жюри или других участников, не связанные с решением заданий. Командам также запрещается использовать уязвимости сервера заданий с целью получения незаслуженных баллов. Команды-нарушители могут быть оштрафованы или дисквалифицированы по решению Жюри.<li>Организаторы соревнований прикладывают все усилия для того, чтобы игра была качественной и интересной. Тем не менее, во время игры могут возникнуть исключительные ситуации. Мы просим команды с пониманием относиться к такой возможности и к решениям, которые будут приняты организаторами в этих ситуациях.Официальными источниками информации по соревнованию являются: этот сайт, группа ВКонтакте <a href=\"http://vk.com/qctfcontest\">http://vk.com/qctfcontest</a>, письма организаторов, отправленные с адреса qctf@hackerdom.ru.<li> Для участия в соревновании команде необходимо подать заявку на сайте, а также прийти на очную регистрацию для получения авторизационных данных.В день соревнования каждой команде будет предоставлено рабочее место, оборудованное:<ul><li>Двумя компьютерами под управлением ОС Windows, с выходом в интернет;<li>Сетевым фильтром для подключения ноутбуков;<li>Достаточным Wi-Fi сигналом для подключения ваших ноутбуков к сети интернет.</ul></ul></p><p>Вопросы и замечания присылайте на почту: <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a>.</p>', '3 апреля&nbsp;2016&nbsp;г.', 1, '<i>Расписание предварительное, возможны изменения!</i>\r\n', '', 0);
INSERT INTO `contests` (`shortname`, `title`, `description`, `index_text`, `rules`, `date`, `past`, `schedule`, `results`, `show_schedule`) VALUES
('school-2018', 'QCTF School 2018', 'Соревнования по правилам QCTF для школьников старших классов. Проводится с 2013 года (<a href=\"/school-2013/\">Ural SchoolCTF</a>). С&nbsp;<a href=\"/school-2014/\">2014 года</a> проводится в разных городах России.', '<p>\r\nCTF (Capture The Flag) — это командные соревнования, цель которых — оценка умения участников разбираться в компьютерах. \r\n</p>\r\n<p>\r\nКомандам даётся набор заданий из разных областей знаний. Команда выполняет их любым доступным образом. Результатом решения является некоторая строка, которую и необходимо отправить на проверку.\r\n</p>\r\n<p>\r\nБолее подробную информацию о предстоящих соревнованиях вы можете найти на <a href=\"rules.php\">странице правил</a>.\r\n</p>\r\n<p>\r\nПишите нам на <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a>.\r\n</p>\r\n<p>Задания прошлых лет доступны вместе с разборами на гитхабе: <a href=\"https://github.com/HackerDom/qctf-school-2016\">2016</a>, <a href=\"https://github.com/HackerDom/qctf-school-2015\">2015</a>, <a href=\"https://github.com/HackerDom/qctf-school-2014\">2014</a>', '<p>Данные правила могут измениться в любой момент до начала соревнования. Не забудьте прочитать их еще раз непосредственно перед началом игры.</p><ul><li>Соревнования QCTF School проводятся очно в специально организованных точках проведения.<li>К участию в соревновании допускаются только школьники, являющиеся учащимися средних учебных заведений в 2017-2018 учебном году и на момент проведения соревнования.<li>Соревнования командные. К участию допускаются команды, состоящие не более чем из 4 человек, среди которых обязательно присутствует капитан. Состав команды нельзя менять после начала игры.<li>Командам будет предложено решить задания. За успешное решение задания команда получает баллы, количество которых зависит от сложности задания. Цель команды &mdash; набрать как можно больше баллов.<li>Задания  размещаются на специальном сервере заданий. Командам перед началом игры будут выданы данные для доступа к нему.<li> Для сторонних наблюдателей доступен публичный монитор, на котором они смогут следить за прогрессом команд. Ссылка на монитор будет опубликована на данном сайте после начала игры.<li>Во время соревнований командам запрещается генерировать неоправданно большой объем трафика и проводить DoS-атаки на жюри или других участников, не связанные с решением заданий. Командам также запрещается использовать уязвимости сервера заданий с целью получения незаслуженных баллов. Команды-нарушители могут быть оштрафованы или дисквалифицированы по решению Жюри.<li>Организаторы соревнований прикладывают все усилия для того, чтобы игра была качественной и интересной. Тем не менее, во время игры могут возникнуть исключительные ситуации. Мы просим команды с пониманием относиться к такой возможности и к решениям, которые будут приняты организаторами в этих ситуациях.Официальными источниками информации по соревнованию являются: этот сайт, группа ВКонтакте <a href=\"http://vk.com/qctfcontest\">http://vk.com/qctfcontest</a>, письма организаторов, отправленные с адреса qctf@hackerdom.ru.<li> Запрещено обмениваться ответами или решениями во время соревнования. Если организаторы обнаружат факт списывания, то обе команды, принимающие в нем участие, будут дисквалифицированы.<li> Запрещено выкладывать в открытый доступ условия или разборы заданий до окончания соревнований во всех часовых поясах.<li> Для участия в соревновании команде необходимо подать заявку на сайте, а также прийти на очную регистрацию для получения авторизационных данных.В день соревнования каждой команде будет предоставлено рабочее место, оборудованное:<ul><li>Указанное при регистрации количество компьютеров под управлением ОС Windows, с выходом в интернет;<li>Сетевым фильтром для подключения ноутбуков;<li>Достаточным Wi-Fi сигналом для подключения ваших ноутбуков к сети интернет.</ul></ul></p><p>Вопросы и замечания присылайте на почту: <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a>.</p>