INSERT INTO `contests` (`shortname`, `title`, `description`, `index_text`, `rules`, `date`, `past`, `schedule`, `results`, `show_schedule`) VALUES
('starter-2013', 'QCTF Starter 2013', 'QCTF — это соревнования по правилам CTF, в которых очно участвуют команды не более, чем из <strong>четырех человек</strong>.', '<p>Соревнование QCTF Starter предназначено для <strong>новичков</strong>. Мы не допускаем к игре людей, которые принимали участие в двух или более RuCTF Quals (большие всероссийские соревнования, см. <a href=\"http://ructf.org/\" target=\"_blank\">http://ructf.org</a>)</p>\n<p>Не стоит бояться слов «компьютерная безопасность» (особенно, если вы с ней раньше не сталкивались), на самом деле QCTF больше похож на соревнование, в которых побеждает тот, кто лучше знает компьютеры — языки программирования, сети, протоколы, файлы, операционные системы и так далее</p>\n<p>QCTF Starter пройдет по следующим несложным правилам:</p>\n<ul>\n<li>Командам даётся набор заданий из разных областей знаний компьютерных технологий и компьютерной безопасности;</li>\n<li>Команда пытается выполнить задания, применяя любые накопленные ими знания;</li>\n<li>Ответом к заданию является строка, которую мы называем <em>ключом</em>, и который необходимо отправить на проверку.</li>\n</ul>\n<p>Подобные правила соревнования вы можете найти на <a href=\"rules.php\">специальной странице</a>. А если у вас остались вопросы, пишите на <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a>.</p>\n<p>Если вы до сих пор боялись попробовать себе в подобных соревнованиях, сейчас самое время! А чтобы было еще менее страшно, <span>предлагаем вам узнать, как решать некоторые задания, а также потренироваться и попробовать свои силы в двух темах:</span></p>\n<ul>\n<li><a class=\"internal\" href=\"network.php\">Network and Dumps</a></li>\n<li><a class=\"internal\" href=\"reverse.php\">Reverse and Binary</a> </li>\n</ul>', '<h3>Правила соревнований</h3>\n<p>Данные правила могут измениться в любой момент до начала отборочного этапа. Не забудьте прочитать их еще раз непосредственно перед началом игры.</p>\n<ul>\n<li>Соревнования по защите информации QCTF проходят очно в здании <a href=\"http://maps.yandex.ru/-/CVbPzB5E\" title=\"На Яндекс.Картах\">ИМКН УрФУ</a>.</li>\n<li>Соревнования <strong>командные</strong>. К участию допускаются команды, состоящие не более чем из 4 человек, среди которых обязательно присутствует <strong>капитан</strong>. Состав команды нельзя менять после начала игры.</li>\n<li>Командам будет предложено решить <strong>задания</strong>. За успешное решение задания команда получает баллы, количество которых зависит от сложности задания. Цель команды - набрать как можно больше баллов.</li>\n<li>Задания  размещаются на специальном сервере заданий. Командам перед началом игры будут выданы данные для доступа к нему. </li>\n<li>Для сторонних наблюдателей доступен <strong>публичный монитор</strong>, на котором они смогут следить за прогрессом команд. Ссылка на монитор будет опубликована на данном сайте после начала игры.</li>\n<li>Во время соревнований командам запрещается генерировать неоправданно большой объем трафика и проводить DoS-атаки на жюри или других участников, не связанные с решением заданий. Командам также запрещается использовать уязвимости сервера заданий с целью получения незаслуженных баллов. Команды-нарушители могут быть оштрафованы или дисквалифицированы по решению Жюри.</li>\n<li>Организаторы соревнований прикладывают все усилия для того, чтобы игра была качественной и интересной. Тем не менее, во время игры могут возникнуть исключительные ситуации. Мы просим команды с пониманием относиться к такой возможности и к решениям, которые будут приняты организаторами в этих ситуациях.</li>\n<li>Официальными источниками информации по соревнованию являются: этот сайт, группа ВКонтакте <a class=\"wk_vk_link\" href=\"http://vk.com/qctfcontest\">http://vk.com/qctfcontest</a>, письма организаторов, отправленные с адреса qctf@hackerdom.ru.</li>\n<li><strong>К соревнованию QCTF Starter допускаются только участники, не принимавшие раньше участия в соревнованиях <a class=\"wk_ext_link\" href=\"https://vk.com/away.php?to=http%3A%2F%2Fructf.org\" target=\"_blank\">RuCTF</a> (или его организации), либо принимавшие участие ровно один раз.</strong></li>\n</ul>\n<div> </div>\n<ul>\n<li>Для участия в соревновании команде необходимо подать заявку на сайте, а также прийти на очную регистрацию для получения авторизационных данных.</li>\n<li>В день соревнования каждой команде будет предоставлено рабочее место, оборудованное:\n<ul>\n<li>Двумя компьютерами под управлением ОС Windows, с выходом в интернет.</li>\n<li>Сетевым фильтром для подключения ноутбуков</li>\n<li>Достаточным Wi-Fi сигналом для подключения ваших ноутбуков к сети интернет.</li>\n</ul>\n</li>\n</ul>\n<p>Вопросы и замечания присылайте на почту: <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a></p>', '15 декабря 2013 г.', 1, '', '', 0),
('starter-2014', 'QCTF Starter 2014', 'QCTF Starter — это соревнования для новичков по правилам CTF.', '<p>Соревнование QCTF Starter предназначено для <strong>новичков</strong>. Мы не допускаем к игре людей, которые принимали участие в двух или более RuCTF Quals (большие всероссийские соревнования, см. <a href=\"http://ructf.org/\" target=\"_blank\">http://ructf.org</a>)</p>\r\n<p>Не стоит бояться слов «компьютерная безопасность» (особенно, если вы с ней раньше не сталкивались), на самом деле QCTF больше похож на соревнование, в которых побеждает тот, кто лучше знает компьютеры — языки программирования, сети, протоколы, файлы, операционные системы и так далее</p>\r\n<p>QCTF Starter пройдет по следующим несложным правилам:</p>\r\n<ul>\r\n<li>Командам даётся набор заданий из разных областей знаний компьютерных технологий и компьютерной безопасности;</li>\r\n<li>Команда пытается выполнить задания, применяя любые накопленные ими знания;</li>\r\n<li>Ответом к заданию является строка, которую мы называем <em>ключом</em>, и который необходимо отправить на проверку.</li>\r\n</ul>\r\n<p>Подобные правила соревнования вы можете найти на <a href=\"rules.php\">специальной странице</a>. А если у вас остались вопросы, пишите на <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a>.</p>\r\n<p>Если вы до сих пор боялись попробовать себе в подобных соревнованиях, сейчас самое время! А чтобы было еще менее страшно, <span>предлагаем вам узнать, как решать некоторые задания, а также потренироваться и попробовать свои силы в двух темах:</span></p>\r\n<ul>\r\n<li><a class=\"internal\" href=\"network.php\">Network and Dumps</a></li>\r\n<li><a class=\"internal\" href=\"reverse.php\">Reverse and Binary</a> </li>\r\n</ul>', '<h3>Правила соревнований</h3>\r\n<p>Данные правила могут измениться в любой момент до начала отборочного этапа. Не забудьте прочитать их еще раз непосредственно перед началом игры.</p>\r\n<ul>\r\n<li>Соревнования по защите информации QCTF проходят очно в здании <a href=\"http://maps.yandex.ru/-/CVbPzB5E\" title=\"На Яндекс.Картах\">ИМКН УрФУ</a>.</li>\r\n<li>Соревнования <strong>командные</strong>. К участию допускаются команды, состоящие не более чем из 4 человек, среди которых обязательно присутствует <strong>капитан</strong>. Состав команды нельзя менять после начала игры.</li>\r\n<li>Командам будет предложено решить <strong>задания</strong>. За успешное решение задания команда получает баллы, количество которых зависит от сложности задания. Цель команды - набрать как можно больше баллов.</li>\r\n<li>Задания  размещаются на специальном сервере заданий. Командам перед началом игры будут выданы данные для доступа к нему. </li>\r\n<li>Для сторонних наблюдателей доступен <strong>публичный монитор</strong>, на котором они смогут следить за прогрессом команд. Ссылка на монитор будет опубликована на данном сайте после начала игры.</li>\r\n<li>Во время соревнований командам запрещается генерировать неоправданно большой объем трафика и проводить DoS-атаки на жюри или других участников, не связанные с решением заданий. Командам также запрещается использовать уязвимости сервера заданий с целью получения незаслуженных баллов. Команды-нарушители могут быть оштрафованы или дисквалифицированы по решению Жюри.</li>\r\n<li>Организаторы соревнований прикладывают все усилия для того, чтобы игра была качественной и интересной. Тем не менее, во время игры могут возникнуть исключительные ситуации. Мы просим команды с пониманием относиться к такой возможности и к решениям, которые будут приняты организаторами в этих ситуациях.</li>\r\n<li>Официальными источниками информации по соревнованию являются: этот сайт, группа ВКонтакте <a class=\"wk_vk_link\" href=\"http://vk.com/qctfcontest\">http://vk.com/qctfcontest</a>, письма организаторов, отправленные с адреса qctf@hackerdom.ru.</li>\r\n<li><strong>К соревнованию QCTF Starter допускаются только участники, не принимавшие раньше участия в соревнованиях <a class=\"wk_ext_link\" href=\"http://ructf.org\" target=\"_blank\">RuCTF</a> (или его организации), либо принимавшие участие ровно один раз.</strong></li>\r\n</ul>\r\n<div> </div>\r\n<ul>\r\n<li>Для участия в соревновании команде необходимо подать заявку на сайте, а также прийти на очную регистрацию для получения авторизационных данных.</li>\r\n<li>В день соревнования каждой команде будет предоставлено рабочее место, оборудованное:\r\n<ul>\r\n<li>Двумя компьютерами под управлением ОС Windows, с выходом в интернет.</li>\r\n<li>Сетевым фильтром для подключения ноутбуков</li>\r\n<li>Достаточным Wi-Fi сигналом для подключения ваших ноутбуков к сети интернет.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>Вопросы и замечания присылайте на почту: <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a></p>', '14 декабря 2014 г.', 1, '<i>Время на этой странице &mdash; местное</i><h3>Екатеринбург</h3><p>Участники из Екатеринбурга &mdash; обратите внимание, что заходить в УрФУ нужно через главный вход (пр. Ленина, 51)</p><ul><li>9:30 &mdash; Регистрация (холл)<li>10:00 &mdash; Открытие<li>10:30 &mdash; Начало соревнования<li>14:30&ndash;15:00 &mdash; Обеденный перерыв (ауд. 532)<li>15:00 &mdash; Соревнование продолжается<li>19:00 &mdash; Окончание соревнования<li>19:30 &mdash; Разбор задач и награждение победителей</ul><h3>Томск</h3><ul><li>11:00 &mdash; Регистрация и открытие (ауд. 204 второго корпуса ТГУ, пр. Ленина, 36)<li>11:30 &mdash; Начало соревнования<li>15:30&ndash;16:00 &mdash; Обеденный перерыв<li>16:00 &mdash; Соревнование продолжается<li>20:00 &mdash; Окончание соревнования<li>20:30 &mdash; Награждение победителей</ul><h3>Челябинск</h3><ul><li>10:00 &mdash; Регистрация и открытие<li>10:30 &mdash; Начало соревнования<li>14:30&ndash;15:00 &mdash; Обеденный перерыв<li>15:00 &mdash; Соревнование продолжается<li>19:00 &mdash; Окончание соревнования<li>19:30 &mdash; Награждение победителей</ul><h3>МФТИ</h3><ul><li>10:00 — Регистрация и открытие<li>10:30 — Начало соревнования<li>14:30–15:00 — Обеденный перерыв<li>15:00 — Соревнование продолжается<li>19:00 — Окончание соревнования<li>19:30 — Награждение победителей</ul>', '<style>   .team-members {     font-size: 70%;   }    .team-name {     color: rgb(90, 90, 255);   }    .team-name div {     color: white;   } </style>      <table class=\"table table-striped table-hover table-responsive\">     <thead>       <th>№</th><th>Название команды</th><th>Очки</th>     </thead>              <tr>             <td width=50>1–3</td><td class=\"team-name\">Destructive Voice</td><td class=\"team-score\">700</td>         </tr>              <tr>             <td width=50>1–3</td><td class=\"team-name\">MicroBears</td><td class=\"team-score\">700</td>         </tr>          <tr>             <td width=50>1–3</td><td class=\"team-name\">«&nbsp;&nbsp;&nbsp;&nbsp;»</td><td class=\"team-score\">700</td>         </tr>              <tr>             <td width=50>4–7</td><td class=\"team-name\">0xAEAE</td><td class=\"team-score\">600</td>         </tr>              <tr>             <td width=50>4–7</td><td class=\"team-name\">orz</td><td class=\"team-score\">600</td>         </tr>              <tr>             <td width=50>4–7</td><td class=\"team-name\">Dandelion</td><td class=\"team-score\">600</td>         </tr>              <tr>             <td width=50>4–7</td><td class=\"team-name\">ASMиноги</td><td class=\"team-score\">600</td>         </tr>              <tr>             <td width=50>8–10</td><td class=\"team-name\">SnowNiggers</td><td class=\"team-score\">500</td>         </tr>              <tr>             <td width=50>8­10</td><td class=\"team-name\">Curiosity</td><td class=\"team-score\">500</td>         </tr>              <tr>             <td width=50>8­10</td><td class=\"team-name\">AC-Adapter</td><td class=\"team-score\">500</td>         </tr>              <tr>             <td width=50>11–12</td><td class=\"team-name\">Lalochka</td><td class=\"team-score\">400</td>         </tr>              <tr>             <td width=50>11–12</td><td class=\"team