ores-area\">Площадка: Аэрокосмический колледж СибГАУ, Красноярск</span></td><td>0</td></tr>\r\n<tr><td class=\"scores-place\">205</td><td class=\"scores-name\">Brainfuck (ТГУ)<br><small>Сайфулин Эдуард Риялович, Костенко Владимир</small><br><span class=\"scores-area\">Площадка: ТГУ, Томск</span></td><td>0</td></tr>\r\n<tr><td class=\"scores-place\">206</td><td class=\"scores-name\">BlazeIT (МИРЭА)<br><small>Изоскин Юрий, Морозов Станислав, Чачанагов Сергей, Марчук Артем</small><br><span class=\"scores-area\">Площадка: МИРЭА, Москва</span></td><td>0</td></tr>\r\n<tr><td class=\"scores-place\">207</td><td class=\"scores-name\">Bananъ (УрФУ)<br><small>Свалова Настя, Загнойко Александр, Амиров Михаил, Антон Мухинский</small><br><span class=\"scores-area\">Площадка: УрФУ, Екатеринбург</span></td><td>0</td></tr>\r\n<tr><td class=\"scores-place\">208</td><td class=\"scores-name\"> 2k_b0gi (МФТИ)<br><small>Карлов Владислав, Кожевников Никита, Воловик Тимур</small><br><span class=\"scores-area\">Площадка: МФТИ, Москва</span></td><td>0</td></tr>\r\n\r\n</tbody></table>\r\n', 0);
INSERT INTO `contests` (`shortname`, `title`, `description`, `index_text`, `rules`, `date`, `past`, `schedule`, `results`, `show_schedule`) VALUES
('starter-2016', 'QCTF Starter 2016', 'QCTF Starter — это соревнования для новичков по правилам CTF', '<p>Соревнование QCTF Starter предназначено для <strong>новичков</strong>. Мы не допускаем к игре людей, которые принимали участие в двух или более RuCTF (большие всероссийские соревнования, см. <a href=\"http://ructf.org/\" target=\"_blank\">http://ructf.org</a>)</p>\r\n<p>Не стоит бояться слов «компьютерная безопасность» (особенно, если вы с ней раньше не сталкивались), на самом деле QCTF больше похож на соревнование, в которых побеждает тот, кто лучше знает компьютеры — языки программирования, сети, протоколы, файлы, операционные системы и так далее</p>\r\n<p>QCTF Starter пройдет по следующим несложным правилам:</p>\r\n<ul>\r\n<li>Командам даётся набор заданий из разных областей знаний компьютерных технологий и компьютерной безопасности;</li>\r\n<li>Команда пытается выполнить задания, применяя любые накопленные ими знания;</li>\r\n<li>Ответом к заданию является строка, которую мы называем <em>ключом</em>, и который необходимо отправить на проверку.</li>\r\n</ul>\r\n<p>Подобные правила соревнования вы можете найти на <a href=\"rules.php\">специальной странице</a>. А если у вас остались вопросы, пишите на <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a>.</p>\r\n<p>Если вы до сих пор боялись попробовать себе в подобных соревнованиях, сейчас самое время! А чтобы было еще менее страшно, <span>предлагаем вам узнать, как решать некоторые задания, а также потренироваться и попробовать свои силы в двух темах:</span></p>\r\n<ul>\r\n<li><a class=\"internal\" href=\"network.php\">Network and Dumps</a></li>\r\n<li><a class=\"internal\" href=\"reverse.php\">Reverse and Binary</a> </li>\r\n</ul>', '<h3>Правила соревнований</h3>\r\n<p>Данные правила могут измениться в любой момент до начала отборочного этапа. Не забудьте прочитать их еще раз непосредственно перед началом игры.</p>\r\n<ul>\r\n	<li>Соревнования <strong>командные</strong>. К участию допускаются команды, состоящие не более чем из 4 человек, среди которых обязательно присутствует <strong>капитан</strong>. Состав команды нельзя менять после начала игры.</li>\r\n	<li>Командам будет предложено решить <strong>задания</strong>. За успешное решение задания команда получает баллы, количество которых зависит от сложности задания. Цель команды — набрать как можно больше баллов.</li>\r\n	<li>Команды могут принести с собой ноутбуки и другое компьютерное оборудование: компьютеры, мониторы, сетевые устройства</li>\r\n	<li>Соревнование длится ровно 8 часов</li>\r\n	<li>Время начала соревнования может различаться на разных площадках</li>\r\n	<li>Задания  размещаются на специальном сервере заданий. Командам перед началом игры будут выданы данные для доступа к нему. </li>\r\n	<li>Для сторонних наблюдателей доступен <strong>публичный монитор</strong>, на котором они смогут следить за прогрессом команд. Ссылка на монитор будет опубликована на данном сайте после начала игры.</li>\r\n	<li>Во время соревнований командам запрещается генерировать неоправданно большой объем трафика и проводить DoS-атаки на жюри или других участников, не связанные с решением заданий. Командам также запрещается использовать уязвимости сервера заданий с целью получения незаслуженных баллов. Команды-нарушители могут быть оштрафованы или дисквалифицированы по решению Жюри.</li>\r\n	<li>Организаторы соревнований прикладывают все усилия для того, чтобы игра была качественной и интересной. Тем не менее, во время игры могут возникнуть исключительные ситуации. Мы просим команды с пониманием относиться к такой возможности и к решениям, которые будут приняты организаторами в этих ситуациях.</li>\r\n	<li>Официальными источниками информации по соревнованию являются: этот сайт, группа ВКонтакте <a class=\"wk_vk_link\" href=\"http://vk.com/qctfcontest\">http://vk.com/qctfcontest</a>, письма организаторов, отправленные с адреса qctf@hackerdom.ru.</li>\r\n	<li><strong>К соревнованию QCTF Starter допускаются только участники, не принимавшие раньше участия в соревнованиях <a class=\"wk_ext_link\" href=\"http://ructf.org\" target=\"_blank\">RuCTF</a> (или его организации), либо принимавшие участие ровно один раз.</strong></li>\r\n</ul>\r\n<div> </div>\r\n<ul>\r\n	<li>Для участия в соревновании команде необходимо подать заявку на сайте, а также прийти на очную регистрацию для получения авторизационных данных.</li>\r\n	<li>В день соревнования каждой команде будет предоставлено рабочее место, оборудованное:\r\n		<ul>\r\n			<li>Двумя компьютерами под управлением ОС Windows, с выходом в интернет.</li>\r\n			<li>Сетевым фильтром для подключения ноутбуков</li>\r\n			<li>Достаточным Wi-Fi сигналом для подключения ваших ноутбуков к сети интернет.</li>\r\n		</ul>\r\n	</li>\r\n</ul>\r\n<p>Вопросы и замечания присылайте на почту: <a href=\"mailto:qctf@hackerdom.ru\">qctf@hackerdom.ru</a></p>', '27 ноября 2016 г.', 1, 'Обратите внимание, что время везде указано местное.\r\n\r\nЛучше приходить за 10-15 минут до начала мероприятия (открытия или непосредственно тура, если открытия на площадке не предполагается).', '<table class=\"table table-striped\">\r\n        <thead>\r\n          <tr>\r\n            <th>Место</th>\r\n            <th>Команда</th>\r\n            <th>Баланс</th>\r\n            <th>Заданий</th>\r\n            <th>Покупок на бирже</th>\r\n            <th>Площадка</th>\r\n          </tr>\r\n        </thead>\r\n        <tbody>\r\n          \r\n            <tr>\r\n              <td>1</td>\r\n              <td>HackerCoolTeamname</td>\r\n              <td>2600</td>\r\n              <td>10</td>\r\n              <td>0</td>\r\n              <td>ИТМО, Санкт-Петербург</td>\r\n            </tr>\r\n          \r\n            <tr>\r\n              <td>2</td>\r\n              <td>Opportunity</td>\r\n              <td>2400</td>\r\n              <td>10</td>\r\n              <td>0</td>\r\n              <td>УрФУ, Екатеринбург</td>\r\n            </tr>\r\n          \r\n            <tr>\r\n              <td>3</