(13, 'starter-2015', 'ekb-urfu', 'Екатеринбург', 'Уральский федеральный университет', 0, 1, 'http://urfu.ru', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.\r\n\r\nВаша площадка пройдёт в Институте математики и компьютерных наук Уральского федерального университета по адресу ул. Тургенева, 4.\r\n\r\nПолу-официальное открытие соревнования состоится в 10:30. Начало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до открытия.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nАндрей Гейн,\r\nКоманда QCTF', '10:00 — Регистрация, можно начинать приходить  на Тургенева, 4\r\n10:30 — Открытие, аудитория 621\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', '', ''),
(14, 'starter-2015', 'minsk-bsuir', 'Минск, Беларусь', 'Белорусский государственный университет информатики и радиоэлектроники', 0, 1, 'http://www.bsuir.by', 0, 1, 'Добрый день, %NAME%!Вы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.Ваша площадка пройдёт в Белорусском государственном университете информатики и радиоэлектроники по адресу ул. Гикало, 9.Начало тура — ровно в 9:00. Тур идёт восемь часов и закончится в 17:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.Если вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.По всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь в нашей группе ВК: https://vk.com/qctfcontestАндрей Гейн,Команда QCTF', '9:00 — Начало тура\r\n17:00 — Окончание тура\r\n17:30 — Подведение итогов', '', '', '', ''),
(15, 'starter-2015', 'samara-sgu', 'Самара', 'Самарский государственный университет', 0, 1, 'http://samsu.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.\r\n\r\nВаша площадка пройдёт в Самарском государственном университете.\r\n\r\nНачало тура — ровно в 11:00 московского (12:00 местного) времени. Тур идёт восемь часов и закончится в 20:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nАндрей Гейн,\r\nКоманда QCTF', '12:00 — Начало тура\r\n20:00 — Окончание тура\r\n20:30 — Подведение итогов', '', '', '', ''),
(16, 'starter-2015', 'spb-spbgu', 'Санкт-Петербург', 'ЗАО Ланит-Терком', 0, 1, 'http://www.lanit-tercom.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.\r\n\r\nВаша площадка пройдёт в помещениях математико-механического факультета СПбГУ по адресу Петергоф, Университетский пр., 28. Объявление о точном месте проведения будет висеть у входа в здание.\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nДля получения оперативной информации о вашей площадке советуем вступить в группу https://vk.com/peterpenctf (однако самое важное мы, конечно, пришлём на почту).\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nАндрей Гейн,\r\nКоманда QCTF', 'Аудитории математико-механического факультета СПбГУ по адресу Петергоф, Университетский пр., 28. Объявление о точном месте проведения будет висеть у входа в здание.\r\n\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', '', ''),
(17, 'starter-2015', 'taganrog-ufu', 'Таганрог', 'Южный федеральный университет', 0, 1, 'https://www.sfedu.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.\r\n\r\nВаша площадка пройдёт в Южном федеральном университете по адресу ул. Чехова, 2, ауд. И-241.\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nАндрей Гейн,\r\nКоманда QCTF', 'Таганрог, ул. Чехова, 2, ауд. И-241\r\n\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', '', ''),
(18, 'starter-2015', 'tomsk-tgu', 'Томск', 'Томский государственный университет', 0, 1, 'http://www.tsu.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.\r\n\r\nВаша площадка пройдёт в Томском государственном университете по адресу пр. Ленина, 36, ауд. 204 второго корпуса ТГУ. \r\n\r\nОфициальное открытие соревнования состоится в 13:20. Начало тура — ровно в 11:00 московского (14:00 местного) времени. Тур идёт восемь часов и закончится в 22:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до открытия.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nАндрей Гейн,\r\nКоманда QCTF', 'Томск, пр. Ленина, 36, второй корпус ТГУ, ауд. 204\r\n\r\n13:20 — Открытие\r\n14:00 — Начало тура\r\n22:00 — Окончание тура\r\nПосле тура — подведение итогов', '', '', '', ''),
(19, 'starter-2015', 'ptz-petrgu', 'Петрозаводск', 'Петрозаводский государственный университет', 0, 1, 'http://petrsu.ru/', 0, 1, 'Добрый день, %NAME%!Вы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.Ваша площадка пройдёт в Петрозаводском государственном университете.Начало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.Если вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.По всем вопросам пишите на qctf@hackerdom.ru.—Андрей Гейн,Команда QCTF', '11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', '', ''),
(20, 'starter-2015', 'kazan-innopolis', 'Казань', 'Университет Иннополис', 0, 1, 'http://university.innopolis.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.\r\n\r\nВаша площадка пройдёт в университете Иннополис по адресу: г. Иннополис, ул. Университетская, д. 1, проход через главный вход здания университета на 3 этаж, ауд. 313.\r\n\r\nДо г. Иннополиса можно добраться на регулярном шаттле.\r\n28 ноября из Казани от остановки «Комбинат здоровья» (со стороны ул. Право-Булачной) в 8:00 отправится шаттл (на нём будет табличка «Иннополис», вопросы по отправлению шаттла можно задавать по телефону 8-800-222-22-87). Дорога займет около 40-50 минут.\r\nОбратно до Казани также можно добраться на шаттле — отправление в 19:50 и 21:50​.\r\n\r\nТоржественное открытие состоится в 10:00, начало тура ровно в 11:00 местного времени. Тур идёт восемь часов и закончится в 20:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 10-20 минут до открытия.\r\n\r\nПо вопросам организации площадки в Иннополисе вы можете писать по адресу e.gubina@innopolis.ru.\r\nПо всем остальным вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nАндрей Гейн,\r\nКоманда QCTF', 'г. Иннополис, ул. Университетская, д. 1, проход через главный вход здания университета на 3 этаж, ауд. 313.\r\n\r\n<small>\r\nДо г. Иннополиса можно добраться на регулярном шаттле.\r\n28 ноября из Казани от остановки «Комбинат здоровья» (со стороны ул. Право-Булачной) в 8:00 отправится шаттл (на нём будет табличка «Иннополис», вопросы по отправлению шаттла можно задавать по телефону 8-800-222-22-87). Дорога займет около 40-50 минут.\r\nОбратно до Казани также можно добраться на шаттле — отправление в 19:50 и 21:50​.\r\n</small>\r\n\r\n10:00 — Открытие\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', '', ''),
(21, 'starter-2015', 'chel-chelgu', 'Челябинск', 'Челябинский государственный университет', 0, 1, 'http://csu.ru', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.\r\n\r\nВаша площадка пройдёт в Челябинском государственном университете по адресу ул. Братьев Кашириных 129, ауд. 132 и 132б.\r\n\r\nНачало тура — ровно в 9:00 московского (11:00 местного) времени. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nАндрей Гейн,\r\nКоманда QCTF', 'Челябинск, ул. Братьев Кашириных 129, ауд. 132 и 132б.\r\n\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', '', ''),
(22, 'starter-2015', 'msk-mirea', 'Москва', 'Московский государственный университет информационных технологий, радиотехники и электроники', 50, 1, 'http://mirea.ru', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.\r\n\r\nВаша площадка пройдёт в Московском государственном университете информационных технологий, радиотехники и электроники по адресу Институт комплексной безопасности и специального приборостроения, пр. Вернадского, д. 78, корпус Е, ауд. 8.\r\n\r\nРегистрация на площадке начнётся с 9:00. Вход в аудитории и настройка рабочих мест возможно с 10:00. Начало тура — ровно в 11:00. Обязательно нужно прийти до начала тура!\r\n\r\nТур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение дипломами и небольшими призами. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nАндрей Гейн,\r\nКоманда QCTF', 'Институт комплексной безопасности и специального приборостроения, пр. Вернадского, д. 78, корпус Е, ауд. 8.\r\n\r\n9:00 — Регистрация\r\n10:00 — Настройка рабочих мест\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', '', ''),
(23, 'starter-2015', 'perm-psu', 'Пермь', 'Пермский государственный национальный исследовательский университет', 50, 1, 'http://psu.ru', 0, 1, 'Добрый день, %NAME%!Вы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.Ваша площадка пройдёт в Пермском государственном национальном исследовательском университете.Начало тура — ровно в 9:00 московского (11:00 местного) времени. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.Если вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.По всем вопросам пишите на qctf@hackerdom.ru.—Андрей Гейн,Команда QCTF', 'ул. Генкеля, 7 (2 корпус). Ауд. 411 расположена около деканата мехмата.\r\n\r\nЕсли вы не знаете где это, то лучше всего позвоните по номеру 89129887513 (Александр), мы вас встретим.\r\n\r\n10:45 - Открытие (ауд. 411)\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', '', ''),
(24, 'starter-2015', 'yar-yargu', 'Ярославль', 'Ярославский государственный университет им. П.Г. Демидова (только для студентов ЯрГУ)', 50, 1, 'http://uniyar.ac.ru', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.\r\n\r\nВаша площадка пройдёт в Ярославском государственном университете им. П.Г. Демидова по адресу ул. Союзная, 144, 7-й корпус ЯрГУ, ауд. 402 и 403.\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nАндрей Гейн,\r\nКоманда QCTF', 'Ярославль, ул. Союзная, 144, 7-й корпус ЯрГУ, ауд. 402 и 403.\r\n\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', '', ''),
(25, 'starter-2015', 'samara-psuti', 'Самара', 'Поволжский государственный университет телекоммуникаций и информатики', 50, 1, 'https://www.psuti.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2015.\r\n\r\nВаша площадка пройдёт в Поволжском государственном университете телекоммуникаций и информатики.\r\n\r\nНачало тура — ровно в 11:00 московского (12:00 местного) времени. Тур идёт восемь часов и закончится в 20:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nАндрей Гейн,\r\nКоманда QCTF', '12:00 — Начало тура\r\n20:00 — Окончание тура\r\n20:30 — Подведение итогов', '', '', '', ''),
