(49, 'starter-2016', 'ekb-urfu', 'Екатеринбург', 'Уральский федеральный университет', 0, 1, 'http://urfu.ru', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2016.\r\n\r\nВаша площадка пройдёт в Институте математики и компьютерных наук Уральского федерального университета по адресу ул. Тургенева, 4.\r\n\r\nПолу-официальное открытие соревнования состоится в 10:30. Начало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до открытия.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2016/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nКискачи Мария,\r\nКоманда QCTF', '10:00 — Регистрация (первый этаж)\r\n10:30 — Открытие (ауд. 532) \r\n11:00 — Начало тура \r\n14:00 — Обед \r\n19:00 — Окончание тура \r\n19:00 — Разбор (ауд. 632) \r\n19:30 — Награждение (ауд. 632)', '', '', 'Екатеринбург, Тургенева, 4', '<p>\r\n<a href=\"https://kontur.ru\">СКБ Контур</a> — федеральный разработчик программного обеспечения для бизнеса\r\n</p>\r\n<p>\r\n<a href=\"https://ideco.ru/\">Айдеко</a> — российский производитель программных продуктов для построения сетей и развития сетевых инфраструктур\r\n</p>'),
