(52, 'starter-2016', 'tomsk-tgu', 'Томск', 'Томский государственный университет', 0, 1, 'http://www.tsu.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2016.\r\n\r\nВаша площадка пройдёт в Томском государственном университете, по адресу пр. Ленина, 36, второй корпус.\r\n\r\nНачало тура — ровно в 7:00 московского (11:00 местного) времени. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2016/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nКискачи Мария,\r\nКоманда QCTF', '11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', 'Томск, пр. Ленина, 36, второй корпус ТГУ', ''),
