(54, 'starter-2016', 'perm-psu', 'Пермь', 'Пермский государственный национальный исследовательский университет', 0, 1, 'http://psu.ru', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2016.\r\n\r\nВаша площадка пройдёт в Пермском государственном национальном исследовательском университете по адресу ул. Букирева, 15.\r\n\r\nНачало тура — ровно в 9:00 московского (11:00 местного) времени. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-30 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2016/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nКискачи Мария,\r\nКоманда QCTF', '11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', 'Пермь, ул. Генкеля 7', '<p><a href=\"http://www.xsolla.com\">Xsolla</a> — ведущий разработчик сервисов по приему платежей для игровых издателей</p>'),
(55, 'starter-2016', 'minsk-bsuir', 'Минск, Беларусь', 'Белорусский государственный университет информатики и радиоэлектроники', 0, 1, 'http://www.bsuir.by', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2016.\r\n\r\nВаша площадка пройдёт в Белорусском государственном университете информатики и радиоэлектроники по адресу ул. Гикало, 9.\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2016/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nКискачи Мария,\r\nКоманда QCTF', '11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', 'Минск, ул. Гикало, 9', ''),
(56, 'starter-2016', 'omsk-omgtu', 'Омск', 'Омский государственный технический университет', 0, 1, 'http://omgtu.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2016.\r\n\r\nВаша площадка пройдёт в Омском региональном парке информационных технологий по адресу пр. Комарова, 21 к.1.\r\n\r\nНачало тура — ровно в 10:00. Тур идёт восемь часов и закончится в 18:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2016/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nКискачи Мария,\r\nКоманда QCTF', '10:00 — Начало тура\r\n18:00 — Окончание тура\r\n18:30 — Подведение итогов', '', '', 'Омск, пр. Комарова, 21 к.1, Омский региональный парк информационных технологий (ИТ-парк)', '<p>При поддержке:\r\n</p>\r\n<p>\r\n<a href=\"http://guit.omskportal.ru/\">Главного управления информационных технологий и связи Омской области</a></p>\r\n<p>\r\n<a href=\"http://omgtu.ru/\">ФГБОУВО «Омский государственный технический университет»</a></p>\r\n<p>\r\n<p>\r\nСпонсор:\r\n</p>\r\n<a href=\"\r\nhttp://ooo-skb.ru/\">ООО \"СКБ\"</a></p>\r\n\r\n'),
