(61, 'starter-2016', 'msk-mirea', 'Москва', 'Московский государственный машиностроительный университет', 100, 1, 'http://www.msiu.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2016.\r\n\r\nВаша площадка пройдёт в Московском государственном машиностроительном университете по адресу ул. Большая Семёновская, 38.\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2016/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nКискачи Мария,\r\nКоманда QCTF', '11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', 'ул. Большая Семёновская, 38', ''),
(62, 'starter-2016', 'msk-mipt', 'Москва', 'Московский физико-технический институт (только для студентов МФТИ)', 0, 0, 'https://mipt.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2016.\r\n\r\nВаша площадка пройдёт в Московском физико-техническом институте по адресу Долгопрудный, Институтский пер., 9.\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2016/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nКискачи Мария,\r\nКоманда QCTF', '11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', 'Москва, Долгопрудный, Институтский пер., 9', ''),
(63, 'starter-2016', 'taganrog-ufu', 'Таганрог', 'Южный федеральный университет', 0, 1, 'https://www.sfedu.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2016.\r\n\r\nВаша площадка пройдёт в Южном федеральном университете по адресу ул. Чехова, 2.\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2016/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nКискачи Мария,\r\nКоманда QCTF', '11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', 'Таганрог, ул. Чехова, 2', ''),
