(67, 'starter-2016', 'yoshkar-pgtu', 'Йошкар-Ола', 'Поволжский государственный технологический университет', 0, 1, 'https://www.volgatech.net', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2016.\r\n\r\nВаша площадка пройдёт в Поволжском государственном тезнологическом университете по адресу ул. Панфилова, 17, корпус 3, аудитория 107.\r\n\r\nПолу-официальное открытие соревнования состоится в 10:30. Начало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до открытия.\r\n\r\nДля студентов ПГТУ нужно иметь при себе студенческий билет и пропуск.\r\n\r\nДля остальных участников нужно иметь при себе паспорт для оформления временного пропуска.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2016/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru.\r\n\r\n—\r\nКискачи Мария,\r\nКоманда QCTF', '10:30 — Открытие\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', 'Йошкар-Ола, ул. Панфилова, 17, корпус 3, аудитория 107', ''),
