(78, 'starter-2018', 'ekb-urfu', 'Екатеринбург', 'Уральский федеральный университет', 0, 1, 'http://urfu.ru', 1, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nПлощадка пройдёт в Институте математики и компьютерных наук Уральского федерального университета по адресу ул. Тургенева, 4.\r\n\r\nТур будет идти 8 часов, с 11 до 19. Регистрация и открытие — с 10:30. Подробное расписание будет опубликовано на нашем сайте qctf.ru, о чём мы ещё обязательно напишем.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК и каналу в Telegram: \r\nhttps://vk.com/qctfcontest\r\nhttps://t.me/qctfcontest\r\n\r\nАлексеев Александр,\r\nКоманда QCTF', '10:00 — Регистрация, можно начинать приходить  на Тургенева, 4\r\n10:30 — Открытие, аудитория 532\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', '', '<p>\r\n<a href=\"https://kontur.ru\">\r\n<img src=\"/static/logos/skbkontur-white.png\" width=\"150\" height=\"auto\" alt=\"СКБ Контур\"/></a>\r\n— федеральный разработчик сервисов для бизнеса.\r\n</p>\r\n'),
