(85, 'starter-2018', 'spb-itmo', 'Санкт-Петербург', 'Университет ИТМО', 0, 1, 'https://vk.com/spbctf', 1, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт в Санкт-Петербургском национальном исследовательском университете информационных технологий, механики и оптики по адресу  \r\nпр. Кронверкский 49.\r\n\r\nПросим придти заранее с 10 до 10:45.\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение.\r\n\r\nНе опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2018/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК и каналу в Telegram: \r\nhttps://vk.com/qctfcontest\r\nhttps://t.me/qctfcontest\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF\r\n', '10:00 - 10:45 - Сбор участников\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', 'Просим не опаздывать и обратить внимание, что у площадки новый актуальный адрес проведения.', '', 'Санкт-Петербург, пр. Кронверкский 49', ''),
