(95, 'starter-2018', 'ptg-skfu', 'Пятигорск', 'Институт сервиса туризма и дизайна (филиал) СКФУ ', 0, 1, 'http://pf.ncfu.ru/', 1, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт на Инженерном факультете Института сервиса туризма и дизайна филиала СКФУ по адресу г. Пятигорск, ул. Ермолова 46, 7 корпус \r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до открытия.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2018/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК и каналу в Telegram: \r\nhttps://vk.com/qctfcontest\r\nhttps://t.me/qctfcontest\r\n\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF', '11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', 'г. Пятигорск, ул. Ермолова 46, 7 корпус Инженерный факультет  аудитории 101Д, 102Д и 103Д ', ''),
(96, 'starter-2018', 'tumen-tgu', 'Тюмень', 'Тюменский государственный университет', 0, 1, 'https://vk.com/tyumenctf', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт в Тюменском государственном университете.\r\n\r\nНачало тура — ровно в 9:00 московского (11:00 местного) времени. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2018/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК: https://vk.com/qctfcontest\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF', 'Расписание (время местное)\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов ', 'Регистрация на площадку закроется 17 февраля 23:59. По возможности рекомендуем брать на соревнование свои ноутбуки.', '', 'г.Тюмень, ул. Перекопская, 15А', ''),
(97, 'starter-2018', 'perm-prk', 'Пермь', 'Пермский радиотехнический колледж им. А. С. Попова', 0, 1, 'https://vk.com/perm_college_radio', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт в КГАПОУ \"Пермский радиотехнический колледж им. А. С. Попова\".\r\n\r\nНачало тура — ровно в 11:00 местного  времени. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2018/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК: https://vk.com/qctfcontest\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF', 'Расписание (время местное)\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов ', '', '', 'Пермь, ул. Танкистов, 46', '<p>\r\n<a href=\"https://xsolla.com\">\r\n<img src=\"/static/logos/xsolla.svg\" width=\"50\" height=\"auto\" alt=\"Xsolla\" /></a>\r\n<a href=\"https://xsolla.com\">Xsolla</a> — дистрибьютор и издатель видеоигр.\r\n</p>'),
(98, 'starter-2018', 'nsk-sibguti', 'Новосибирск', 'Сибирский государственный университет геосистем и технологий', 10, 1, 'http://sgugit.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт в Сибирском государственном университете геосистем и технологий\r\n\r\nНачало тура — ровно в 13:00 местного  времени. Тур идёт восемь часов и закончится в 21:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2018/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК: https://vk.com/qctfcontest\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF', 'Расписание (время местное)\r\n13:00 — Начало тура\r\n21:00 — Окончание тура\r\n21:30 — Подведение итогов ', '', '', 'г.Новосибирск, ул. Пархоменко, дом 9, аудитория 241', '<p>\r\n<a href=\"https://kontur.ru\">\r\n<img src=\"/static/logos/skbkontur-white.png\" width=\"150\" height=\"auto\" alt=\"СКБ Контур\"/></a>\r\n— федеральный разработчик сервисов для бизнеса.\r\n</p>\r\n'),
(99, 'starter-2018', 'krsk-sibsu', 'Красноярск', 'Сибирский государственный университет\r\n науки и технологий имени академика М. Ф. Решетнёва', 0, 1, 'http://sibsau.ru/ ', 1, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт в Сибирском государственном университете науки и технологий имени академика М. Ф. Решетнёва.\r\n\r\nНачало тура — ровно в 11:00 местного  времени. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2018/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК: https://vk.com/qctfcontest\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF', 'Расписание (время местное)\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов ', '', '', 'г. Красноярск, проспект имени Газеты Красноярский Рабочий, 48Б, 3 этаж.', ''),
(100, 'starter-2018', 'simfpl-col', 'Симферополь', 'Таврический колледж ФГАОУ ВО \"Крымский федеральный университет им. В. И. Вернадского', 0, 1, '', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт в Таврическом колледже ФГАОУ ВО \"Крымский федеральный университет им. В. И. Вернадского.\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала.\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2018/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК: https://vk.com/qctfcontest\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF\r\n', '11:00 — Начало тура\r\n19:00 — Окончания тура\r\n19:30 — Подведение итогов', '', '', 'г. Симферополь, ул. Киевская, 116-Б', '');
