(101, 'starter-2018', 'yar-yargu', 'Ярославль', 'Ярославский государственный университет им. П.Г. Демидова (только для студентов ЯрГУ)', 0, 0, 'http://uniyar.ac.ru', 1, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт в Ярославском государственном университете в лаборатории Делоне (бывш. кафе \"ГОРЯЧИЙ ЛЕД\"), ул. Комсомольская, д. 3\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК и каналу в Telegram: \r\nhttps://vk.com/qctfcontest\r\nhttps://t.me/qctfcontest\r\n\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF', '11:00 — Начало тура\r\n19:00 — Окончания тура\r\n19:30 — Подведение итогов', '', '', 'Ярославль, , ул. Комсомольская, д. 3,  \r\nлаборатория Делоне (бывш. кафе \"ГОРЯЧИЙ ЛЕД\")', ''),
(102, 'starter-2018', 'yar-yargu', 'Ярославль', 'Ярославский градостроительный колледж', 0, 0, '', 1, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт в Ярославском градостроительном колледже по адресу  г. Ярославль, ул. Чайковского д. 55\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК и каналу в Telegram: \r\nhttps://vk.com/qctfcontest\r\nhttps://t.me/qctfcontest\r\n\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF', '11:00 — Начало тура\r\n19:00 — Окончания тура\r\n19:30 — Подведение итогов', '', '', 'г. Ярославль, ул. Чайковского д. 55', ''),
(103, 'starter-2018', 'tum-zvd-sch', 'Тюменская область, г. Заводоуковск', 'Заводоуковская средняя общеобразовательная школа № 2', 8, 0, 'http://school-zvd.ru', 1, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт в Заводоуковской средней общеобразовательной школе № 2 по адресу Тюменская область, г. Заводоуковск, ул.Заводская 16.\r\n\r\nНачало тура — ровно в 11:00. Тур идёт восемь часов и закончится в 19:00, после чего будет небольшое награждение. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала тура.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК и каналу в Telegram: \r\nhttps://vk.com/qctfcontest\r\nhttps://t.me/qctfcontest\r\n\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF', '11:00 — Начало тура\r\n19:00 — Окончания тура\r\n19:30 — Подведение итогов', 'Площадка на 8 команд. Регистрация на площадку будет открыта до 20 февраля 23:59.\r\nПо возможности просим команды приходить со своими ноутбуками.\r\n', '', 'Тюменская область, г. Заводоуковск, ул.Заводская 16.', ''),
(104, 'starter-2018', 'habr-tsu', 'Хабаровск', 'Тихоокеанский государственный университет', 0, 1, 'http://pnu.edu.ru/ru/', 1, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт в Тихоокеанском государственном университете по адресу г. Хабаровск, Тихоокеанская 136.\r\n\r\nНачало тура — ровно в 7:00 по москве (14:00 местного времени). Тур идёт восемь часов и закончится в 22:00. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2018/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК и каналу в Telegram: \r\nhttps://vk.com/qctfcontest\r\nhttps://t.me/qctfcontest\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF\r\n', '14:00 — Начало тура\r\n22:00 — Окончание тура\r\n', '', '', 'Хабаровск, Тихоокеанская 136.', ''),
(105, 'starter-2018', 'ekb-usue', 'Екатеринбург', 'Уральский государственный экономический университет', 0, 1, 'http://www.usue.ru/', 0, 1, 'Добрый день, %NAME%!\r\n\r\nВы успешно зарегистрированы в качестве участника команды «%TEAM%» соревнования QCTF Starter 2018.\r\n\r\nВаша площадка пройдёт в Уральском государственном экономическом университете по адресу г. Екатеринбург, ул. 8 Марта, 62.\r\n\r\nНачало тура — ровно в 9:00 по москве (11:00 местного времени). Тур идёт восемь часов и закончится в 19:00. Не опаздывайте, а лучше даже прийти немного заранее — за 15-20 минут до начала.\r\n\r\nЕсли вы по какой-то причине не сможете прийти на соревнование, пожалуйста, сообщите об этом как можно раньше.\r\n\r\nПодробная информация о вашей площадке доступна на странице http://qctf.ru/starter-2018/places/%PLACE%.\r\n\r\nПо всем вопросам пишите на qctf@hackerdom.ru. Присоединяйтесь к нашей группе ВК и каналу в Telegram: \r\nhttps://vk.com/qctfcontest\r\nhttps://t.me/qctfcontest\r\n—\r\nАлександр Алексеев,\r\nКоманда QCTF\r\n', '10:00 — Регистрация, главный вход с 8 Марта\r\n10:30 — Открытие, аудитория 334\r\n11:00 — Начало тура\r\n19:00 — Окончание тура\r\n19:30 — Подведение итогов', '', '', 'г. Екатеринбург, ул. 8 Марта, 62', ''),
